INSERT INTO `accords_classes` VALUES (1,'citrus','감귤류의 향으로서, 남녀 구분없이 대부분 좋아하는 향입니다. 향이 상큼하고 가벼우며 지속력이 약해 탑노트로 많이 사용됩니다.'),(2,'floral','향수의 기초이자 근본이라고 볼 수 있는 향기입니다. 여성 향수에 주로 많이 들어가 있으며 남성 향수에도 소량 배합됩니다. 단아함, 우아함 등 여성미를 느끼게 하는 핵심적인 요소입니다. 꽃의 종류에 따라 플로럴함의 정도나 느낌이 다르게 표현될 수 있습니다. 미들이나 베이스노트로 많이 사용됩니다.'),(3,'herbal','허브 향은 향수에서 주로 시원한 청량감을 주기 위해 사용되며, 특히 아로마 테라피에서 강장, 항진, 거담, 탈취 등의 용도로 다양하게 활용됩니다.'),(4,'fruity','감귤류 향인 citrus를 제외한 과일류의 향을 뜻합니다. 탑노트에 주로 쓰이며 특히 10~20대의 어린 여성들이 선호하는 향수에 많이 들어가 있습니다.'),(5,'spicy','향수의 향의 강도를 전반적으로 강화하고, 특히 첫 느낌을 강하게 주고자 할 때 자주 사용되는 향입니다. 남성향수나 섹시한 느낌을 주는 여성향수에 쓰입니다. 미들 노트 또는 탑노트에 넣어 향을 다채롭게 하는 역할을 합니다. 단독으로 사용할 경우엔 향취가 좋지 않을 수도 있으나 대신 다른 종류의 향과 조합이 되어 적당히 향수의 무게를 더해주며, 관능적이고 섹시한 느낌을 줍니다.'),(6,'animalic','동물과 관련된 냄새로 단독으로 사용할 경우엔 향취가 좋지 않을 수도 있으나 대신 다른 종류의 향과 조합이 되어 적당히 향수의 무게를 더해주며, 관능적이고 섹시한 느낌을 줄 수 있습니다. 주로 베이스 노트로 쓰이며, 우디 및 플로럴 계열의 향료들과 함께 조향하여 사용됩니다.'),(7,'synthetic','인간에 의해서 만들어진 향으로 자연적인 느낌보다는 인조적인 느낌이 나는 향입니다. 아스팔트, 가죽, 스모키 등의 향이 속해있습니다.'),(8,'sweet','달콤한 느낌의 향으로서, 바닐라, 초콜릿 등의 향이 속해있습니다.');
