INSERT INTO `accords` VALUES (1,'Champagne','톡톡 쏘는 듯한 상큼한 향입니다.','https://fimgs.net/mdimg/sastojci/t.400.jpg?1441498366',1),(2,'aldehydic','알데히드란 향미가 자극적이고 기름 같은 향이 특징입니다. 소량으로 사용되며 여성의 우아한 분위기의 향수의 향료로 사용됩니다. 주로 플로럴, 프루티 계열등과 함께 사용되며 쾌적한 향기를 나타냅니다.','https://www.artinsight.co.kr/data/tmp/2206/20220602182600_kcrqtcfb.jpg',1),(3,'almond','아몬드향은 단맛과 쓴맛이 동시에 느껴지는 향기이며 부드럽고 세련된 느낌을 줍니다. ','https://fimgs.net/mdimg/sastojci/t.130.jpg?1440794517',4),(4,'amber','호박석의 부드럽고 따스한 색에서 영감을 받아 이름을 지은 향입니다. 바닐라, 벤조인, 라다넘을 합성해서 만든 향으로 스윗하면서도 우디한 향입니다.','https://fimgs.net/mdimg/sastojci/t.54.jpg?1442952354',6),(5,'animalic','동물향 계통을 일컫는 말이며, 잘 알려진 향으로는 영묘향, 사향, 해리향, 용현향 등이 있습니다.','https://fimgs.net/mdimg/sastojci/t.794.jpg?1454949679',6),(6,'anis','아니스의 향과 맛은 감초보다 약간 더 달콤한 향입니다. 회향과 비슷한 레몬향을 풍기며 시고 단맛이 나는 것이 이 향의 특징입니다.','https://www.fragrantica.com/mdimg/sastojci/t2.393.jpg?1441335087',5),(7,'aquatic','아쿠아틱향은 물에서 느껴지는 상쾌하고 투명한 향입니다.','https://www.fragrantica.com/mdimg/sastojci/t3.324.jpg?1441515778',1),(8,'aromatic','아로마틱향은 로즈메리, 라벤더 등 허브 계열을 표현한 향입니다.','https://fimgs.net/mdimg/sastojci/t.1259.jpg?1646534378',3),(9,'asphault','인공적이고 도시에서의 비냄새가 나는듯한 향입니다.','https://www.fragrantica.com/mdimg/sastojci/t2.556.jpg?1441512994',7),(10,'balsamic','발사믹(balsamic)은 이탈리아말로 \'향기가 좋다\'는 의미로. 향이 좋고 깊은 맛을 지닌 최고급 포도 식초향입니다.','https://fimgs.net/mdimg/sastojci/t.1229.jpg?1640552356',1),(11,'beeswax','꿀향이 강하게 나는 아로마틱한 앰버 향입니다.','https://fimgs.net/mdimg/sastojci/t.53.jpg?1442960316',8),(12,'cacao','발사믹한 느낌이 나는 자극적인 향입니다.','https://www.fragrantica.com/mdimg/sastojci/t2.135.jpg?1441339904',5),(13,'camphor','따끔따끔하고 매운향입니다.','https://fimgs.net/mdimg/sastojci/t.404.jpg?1441254877',3),(14,'caramel','사탕향과 크리미한 버터느낌이 나는 달콤한 향입니다.','https://fimgs.net/mdimg/sastojci/t.183.jpg?1441392265',8),(15,'cherry','단맛이 나는 달콤한 체리향입니다.','https://fimgs.net/mdimg/sastojci/t.297.jpg?1440955691',4),(16,'chocolate','단맛이 나는 달콤한 초콜릿향입니다.','https://www.fragrantica.com/mdimg/sastojci/t2.136.jpg?1441405564',8),(17,'cinnamon','3대 향신료인 시나몬, 후추, 정향 중 하나로 따뜻하고, 과일향이 은은하게 나는 달짝지근한 맛을 가진 계피향입니다.','https://fimgs.net/mdimg/sastojci/t.65.jpg?1441337754',5),(18,'citrus','오렌지, 레몬 등 새콤달콤한 특성을 지닌 과일 향을 뜻합니다.','https://fimgs.net/mdimg/sastojci/t.313.jpg?1440724966',1),(19,'coconut','바닐라 같이 달콤하고 우유맛이 나는 향입니다.','https://www.fragrantica.com/mdimg/sastojci/t2.138.jpg?1440901443',4),(20,'coffee','달콤한 커피향입니다.','https://fimgs.net/mdimg/sastojci/t.139.jpg?1441340808',5),(21,'conifer','톡쏘는 상쾌한 느낌의 향입니다.','https://fimgs.net/mdimg/sastojci/t.1246.jpg?1645517807',4),(22,'earthy','흙, 산림 등 대지에서 비롯된 향입니다.','https://fimgs.net/mdimg/sastojci/t.801.jpg?1585803554',3),(23,'floral','달콤한 꽃냄새가 나는 꽃향기 입니다.','https://fimgs.net/mdimg/sastojci/t.314.jpg?1585616440',2),(24,'fresh','상쾌한 느낌이 나는 향입니다.','https://fimgs.net/mdimg/sastojci/t.1282.jpg?1651194968',3),(25,'fresh spicy','시원하게 톡쏘는 향입니다.','https://www.fragrantica.com/mdimg/sastojci/t3.1282.jpg?1651194968',5),(26,'fruity','농익은 과일의 달콤한 향입니다.','https://fimgs.net/mdimg/sastojci/t.320.jpg?1354330189',4),(27,'green','자연의 냄새가 나는 향기입니다.','https://fimgs.net/mdimg/sastojci/t.318.jpg?1441328078',3),(28,'herbal','녹차 느낌의 향기입니다.','https://www.fragrantica.com/mdimg/sastojci/t3.318.jpg?1441328079',3),(29,'honey','달콤한 꿀냄새가 나는 향기 입니다.','https://fimgs.net/mdimg/sastojci/t.181.jpg?1441599280',8),(30,'iris','포근하고 비누향기가 나는 향이다.','https://fimgs.net/mdimg/sastojci/t.11.jpg?1441132982',2),(31,'lactonic','달콤하고 코코넛 맛의 느낌의 향기입니다.','http://4.bp.blogspot.com/-vFITU_sjiBU/TpL8bSGueHI/AAAAAAAAGTM/mmcIpr65_KY/s1600/thickened%2Bcream%2Band%2Braspberries%2Bbavaroise%2B%2528eatpress.com%2529.jpg',8),(32,'lavender','라벤더의 향은 플로랄과 허브의 혼합형 향이며, 부드러우면서도 상쾌한 느낌이 드는 것이 특징입니다. 라벤더 향은 청결한 이미지가 강하기에 단순히 향수나 에센셜 오일 외에도 화장실 방향제, 차량 방향제, 세정제 등에 많이 첨가되는 향 중 하나입니다.','https://w.namu.la/s/0bfe1152376a37b6c413884fcc1ffe08a360027f1714eed20dd37cf43f8e3ff6e462cb950408de426788ff3f6521fbcb83ae7ba96f530ba5cb3cdad4338fd82a1577c94964bcfb302e5d702c77abe4875c1b6ed9d0f985cbaac46e3927589ccd',3),(33,'leather','가죽향으로 남자 향수에 많이 사용됩니다. 동물적인 요소를 지녀 강한 개성을 느끼게 합니다.','https://fimgs.net/mdimg/sastojci/t.156.jpg?1444596443',6),(34,'marine','바다의 상쾌하고 짭조름한 느낌을 주는 향입니다.','https://fimgs.net/mdimg/sastojci/t.324.jpg?1441515777',7),(35,'metallic','인공적이며 신선한 향입니다.','https://fimgs.net/mdimg/sastojci/t.458.jpg?1441515162',7),(36,'mossy','해조와 같은 향기가 있고, 상당히 지속성이 강한 향기입니다. 전체적으로 점잖고 고전적인 분위기 이지만 격조 높은 세련미를 주는 향기입니다.','https://thumbs.dreamstime.com/b/green-mossy-texture-background-green-mossy-texture-background-ecology-concept-forest-plant-place-text-163127722.jpg',3),(37,'musky','사향이라고도 부르며, 몇 되지않는 동물성 향료이며 가장 귀한 향료로 여겨져 왔습니다. 지금은 합성향으로 만들어져 많이 사용합니다. 따뜻함, 달콤한, 분내음 등으로 표현되고 있습니다.','https://thumbs.dreamstime.com/b/penelope-white-rose-bricks-wall-background-square-photo-image-shrub-strong-branching-bearing-large-trusses-blush-207162045.jpg',6),(38,'nutty','고소하면서 부드러운 느낌으로 아몬드, 헤즐넛, 땅콩, 캐슈넛, 호두를 연상케 하는 향기를 줍니다. ','https://fimgs.net/mdimg/sastojci/t.1023.jpg?1573808397',4),(39,'oud','나무향 뿐만 아니라 열매와 같은 고소한 냄새 등 다양한 향을 느낄 수 있습니다.','https://fimgs.net/mdimg/sastojci/t.114.jpg?1441409728',3),(40,'ozonic','자외선이 풍부한 고산지대나 해안의 공지 등 장소를 이미지화한 향기입니다. 물이나 공기와 같은 맑은 느낌을 줍니다.','https://fimgs.net/mdimg/sastojci/t.669.jpg?1427917954',7),(41,'patchouli','바이올렛은 매우 부드러우면서 고전적인 파우더리한 향기입니다. 바이올렛은 또 아이리스와 향이 비슷한데 아이리스는 뿌리에서 향을 추출하는 반면 바이올렛은 잎에서 향을 추출한다는 차이점이 있습니다.','https://mblogthumb-phinf.pstatic.net/MjAxNzAyMTFfMTIw/MDAxNDg2NzkzOTEyNjg2.R2XLw0PX4tvCV7e50ERtj1LTe0Xs9RlePyF4bVucc6cg.3_mtnkF3SOqlfgrv_z3G7x9FrCZnTuF4VW0rCqQ4QXwg.JPEG.nevaehsalon/violet-flower-1.jpg?type=w2',2),(42,'powdery','베이비 파우더 냄새와 비슷합니다. 겨울에 어울리는 향입니다.','https://fimgs.net/mdimg/sastojci/t.482.jpg?1585701558',7),(43,'rose','장미에서 추출한 향기입니다.','https://fimgs.net/mdimg/sastojci/t.105.jpg?1585546135',2),(44,'rum','달콤하고 아로마틱한 느낌을 주고 수분감이 많은 향입니다.','https://fimgs.net/mdimg/sastojci/t.201.jpg?1441498126',8),(45,'salty','따뜻한 햇볕이 내리는 바다 향입니다. 해변가에서 부는 바람처럼 묵직한 청량감을 줍니다.','https://fimgs.net/mdimg/sastojci/t.231.jpg?1441518477',8),(46,'sand','편안한 미네랄 느낌의 향기입니다.','https://fimgs.net/mdimg/sastojci/t.325.jpg?1441516292',7),(47,'savory','매콤한 향과 톡 쏘는 자극성이 있는 향기입니다.','https://www.spicemountain.co.uk/wp-content/uploads/2019/10/savory_685738297.jpg',5),(48,'smoky','나무를 태울 때나는 향이나 이와 유사한 향입니다.','https://fimgs.net/mdimg/sastojci/t.735.jpg?1585710237',7),(49,'soft spicy','약간 톡쏘는 느낌의 향입니다.','https://www.fragrantica.com/mdimg/sastojci/t2.321.jpg?1441345939',5),(50,'sweet','달콤한 느낌을 주는 향기입니다.','https://q3b5k8v3.stackpathcdn.com/wp-content/uploads/2021/06/halal-swwets.jpeg',8),(51,'terpenic','다양한 종류의 탄소 알코올이 조합된 향입니다.','https://images.squarespace-cdn.com/content/v1/5e35c80a5baacc6c9c9d8aad/1581527293269-9D05AQ428OBE1M7OVTAL/terpineol+new.png?format=500w',7),(52,'tobacco','말린 건초 느낌에서 나는 자연스러운 단내, 스모키함, 따뜻한 허브 향기를 가지고 있습니다.','https://fimgs.net/mdimg/sastojci/t.96.jpg?1441310155',3),(53,'tropical','달콤하고 청량하며 열대 과일의 일반적인 향입니다.','https://www.fragrantica.com/mdimg/sastojci/t2.319.jpg?1440956983',4),(54,'tuberose','월하향 꽃에서 추출한 향으로 지속력이 뛰어나고 모던하면서도 여성스러운 느낌을 줍니다.','https://fimgs.net/mdimg/sastojci/t.25.jpg?1441485342',2),(55,'vanilla','달콤하고 편안해지는 향입니다.','https://fimgs.net/mdimg/sastojci/t.74.jpg?1441420817',5),(56,'violet','제비꽃에서 유래한 향으로 매우 부드러우면서 고전적인 향기입니다.','https://fimgs.net/mdimg/sastojci/t.116.jpg?1441155792',2),(57,'vodka','약간의 아로마틱한 향과 가벼운 알코올 향입니다.','https://fimgs.net/mdimg/sastojci/t.203.jpg?1441499464',7),(58,'warm spicy','은은하게 톡쏘는 향입니다.','https://fimgs.net/mdimg/sastojci/t.321.jpg?1585627858',5),(59,'whiskey','달콤한 건초, 초콜릿, 말린 과일, 꿀 등으로 느껴질 수 있는 복합적인 향입니다.','https://fimgs.net/mdimg/sastojci/t.210.jpg?1441499749',7),(60,'white floral','피오니, 제라늄, 목련, 프리지아, 붓꽃등 흰색꽃에서 추출한 향기입니다.','https://www.fragrantica.com/mdimg/sastojci/t3.314.jpg?1354324430',2),(61,'wine','와인에서 추출한 향기입니다.','https://fimgs.net/mdimg/sastojci/t.464.jpg?1441489973',7),(62,'woody','나무, 숲 속의 향입니다.','https://www.fragrantica.com/mdimg/sastojci/t2.315.jpg?1441417643',3),(63,'yellow floral','참파카, 미모사, 프랑지파니 등 노란꽃에서 추출한 향기입니다.','https://img.freepik.com/free-photo/yellow-flower-white-background_1203-2149.jpg?w=2000',2);
