DROP TABLE IF EXISTS `reviews`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `reviews` (
  `idx` int NOT NULL AUTO_INCREMENT,
  `user_idx` int NOT NULL,
  `perfume_idx` int NOT NULL,
  `review_img` varchar(500) DEFAULT NULL,
  `total_score` int NOT NULL,
  `longevity` int NOT NULL,
  `sillage_score` int NOT NULL,
  `content` varchar(500) DEFAULT NULL,
  `like_count` int NOT NULL DEFAULT '0',
  `time` datetime DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime DEFAULT NULL,
  `is_delete` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`idx`),
  KEY `reviews_FK` (`user_idx`),
  KEY `reviews_FK_1` (`perfume_idx`),
  CONSTRAINT `reviews_FK` FOREIGN KEY (`user_idx`) REFERENCES `users` (`idx`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `reviews_FK_1` FOREIGN KEY (`perfume_idx`) REFERENCES `perfumes` (`idx`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1078 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

