의 파샤 드 카르티에 에디션 노이레는 남성용 우디 아로마틱 향수입니다. 파샤 드 카르티에 에디션 누아르(Pasha de Cartier Edition Noire)는 2013년에 출시되었습니다. 이 향수의 조향사는 나탈리 페이스트하우어입니다.','spring, fall','night',4,2,0,0,NULL,NULL,NULL),(760,'MONTBLANC','Legend Spirit','EDT','Men','Citrus','Grapefruit, Bergamot, Pink Pepper','Water Notes, Lavender, Cardamom','White Musk, White Woods, Cashmere Wood, Oakmoss',4.7,'https://fimgs.net/mdimg/perfume/375x500.33443.jpg','몽블랑의 레전드 스피릿은 남성용 우디 아로마틱 향수입니다. 레전드 스피릿은 2016년에 출시되었습니다. 탑 노트는 자몽, 베르가못, 핑크 페퍼, 미들 노트는 워터 노트, 라벤더, 카다멈, 베이스 노트는 화이트 머스크, 화이트 우즈, 캐시미어 우드, 오크모스입니다.','spring, summer','day',3,2,0,0,NULL,NULL,NULL),(761,'BVLGARI','Petits Et Mamans','EDT','Women','Floral','Brazilian Rosewood, Sicilian Orange, Bergamot','White Peach','Iris and Vanilla',4.8,'https://fimgs.net/mdimg/perfume/375x500.155.jpg','쁘띠셋마만즈 by 블가리는 여성을 위한 플로럴 우디 머스크 향입니다. Petitset Mamans는 1997년에 출시되었습니다. 이 향수의 조향사는 나탈리 로슨입니다. 탑 노트는 브라질산 로즈우드, 시칠리아 오렌지, 베르가못, 미들 노트는 카모마일, 해바라기, 로즈, 베이스 노트는 파우더리 노트, 바닐라, 아이리스, 화이트 피치입니다.','spring, summer','day',3,1,0,0,NULL,NULL,NULL),(762,'Roberto Cavalli','Paradiso Assoluto','EDP','Women','Floral','Wisteria, Pink Pepper, Grapefruit, Bergamot, Lemon','Wild Jasmine, Red Lily, Passionfruit','Patchouli, Sandalwood, Vanilla, Cashmeran',5,'https://fimgs.net/mdimg/perfume/375x500.42009.jpg','Roberto Cavali의 Paradiso Asoluto는 여성을 위한 Chypre Floral 향기입니다. 파라디소 아솔루토는 2016년에 출시되었습니다. 이 향수의 조향사는 루이스 터너입니다. 탑 노트는 위스테리아, 핑크 페퍼, 자몽, 베르가못, 레몬, 미들 노트는 와일드 자스민, 레드 릴리, 패션 프루트, 베이스 노트는 바닐라, 캐시미런, 샌달우드, 파추리입니다.','spring, fall','day',4,2,0,0,NULL,NULL,NULL),(763,'Roberto Cavalli','Paradiso Azzurro','EDP','Women','Fruity','Lavender, Bergamot, Tangerine','Wild Jasmine, Watery Notes, Apple, Tuberose, Peach, Rose','Cypress, Cashmere Wood, Amber wood, Sandalwood, Vanilla',4.7,'https://fimgs.net/mdimg/perfume/375x500.34207.jpg','Roberto Cavali의 Paradiso Azzurro는 여성을 위한 Floral Aquatic 향기입니다. 파라디소 아즈로는 2016년에 출시되었습니다. 이 향수의 조향사는 루이스 터너입니다. 탑 노트는 라벤더, 베르가못, 귤, 미들 노트는 워터리 노트, 와일드 재스민, 사과, 튜버즈, 피치, 로즈, 베이스 노트는 사이프레스, 캐시미어 우드, 앰버우드, 샌달우드, 바닐라입니다.','spring, summer','day',3,2,0,0,NULL,NULL,NULL),(764,'GUESS','Dare','EDT','Women','Citrus','Kumquat, Pear Blossom, Lemon Blossom','Wild Rose, Elegant Jasmine','Coconut Accords, Wood, Musk',4.9,'https://fimgs.net/mdimg/perfume/375x500.26415.jpg','Guess Dare by Guess는 여성을 위한 Floral Woody Musk 향입니다. Guess Dare는 2014년에 출시되었습니다. 이 향수의 조향사는 브루노 조바노비치입니다. 금귤, 배꽃, 레몬블라썸, 미들 노트는 선인장 꽃, 재스민, 와일드 로즈, 베이스 노트는 머스크, 우디 노트, 조향사조향사넛입니다.','spring, summer','day',3,2,0,0,NULL,NULL,NULL),(765,'SWISS ARABIAN','Layali CPO At','EDT','Unisex','Arabian','Plum, Black Currant, Orange Blossom','Ylang-Ylang, Rose and Jasmine','Agarwood and Amber',4,'https://fimgs.net/mdimg/perfume/375x500.20754.jpg','스위스 아라비안의 Layali CPO는 여성을 위한 앰버 플로럴 향입니다. 탑 노트는 플럼, 블랙 커런트, 오렌지 블러썸, 미들 노트는 일랑일랑, 재스민, 로즈, 베이스 노트는 아가우드(우드)와 앰버그리스입니다.','spring, summer','day',5,2,0,0,NULL,NULL,NULL);
